  Grahame b. at Gisborne and m. at Taradale. Kerri, d/o Barrie Thomas Jeffares and Shirley
  Beverly Oliver. Address: Cl- Post Office, Makaraka, Gisborne.
  Grahame graduated in 1977 with a Diploma of Horticulture in Orchard Production and is
  horticultural farming at Makaraka, Gisborne in partnership with his wife. He was also Unit
  Commander of No 14 "City of Gisborne" Squadron, Air Training Corps and holder of a New Zealand
  Cadet Forces Medal for long and meritorious service (12 years commissioned officer rank). He
  resigned from the Corps in 1991,
  Kerri has a Certificate in Early Childhood Education from Massey University in 1996 and is now
  a special needs educator with the Special Education Service.
