  Roger b at Gisborne and m. at Feilding. Jennifer, d/o Stewart Ian Dyke and Colleen Ruth Wilson,
  b. at Feilding. Address: 14 Woodlands Street, Linton Camp, Palmerston North.
  Roger enlisted with the Army as a regular soldier in 1979. After completing his basic training
  at Waiouru, he joined the Royal New Zealand Army Ordnance Corps as a Supplier. He was posted
  to 5 Logistic Regiment then to 21 Field Supply Company at Linton Camp, Palmerston North. He
  acted as Company Sergeant Major for two years and was then posted to the operational HQ of the
  2nd Land Force Camp in Linton.
